function VoyPanel() {
  return(
   <div>
      <img src={"../../static/VoyPhone.png"} alt="Phone with Voy App open"/>
      <div className="content" >
        <a><b>Venture-backed</b></a>
        <a>audio tour application</a>
      </div>
      <style jsx>{`
        padding-top: 10vh;
        display: flex;

        img{
          padding-left: 25vw;
          height: 55vh;
        }
        .content{
          padding-top: 15vh;
          padding-left: 5vw;
        }
        a{
          font-size: 3.5vh;
        }
      `}</style>
    </div>
  )
}
export default VoyPanel
